import React from "react";
import Logo from '../img/informatic tree.png'

function Header(props)
{

    return(
        <div className="Header">
            <a class="logo" href="../App.js"><img src="../img/informatic tree.png" alt="logo" /></a>
            <nav class="navegador-header contenedor">
                <a href="../productos.js">Tienda</a>
                <a href="../terminos-y-condiciones.js">Terminos</a>
                <a href="../sobre-nosotros.js">Nosotros</a>
                <a href="../contacto.js">Soporte</a>
            </nav>
            <div class="logos-header">
                <img src="../img/account_circle_FILL0_wght400_GRAD0_opsz48.png" alt=""></img>
                <img src="../img/shopping_cart_FILL0_wght400_GRAD0_opsz48.png" alt=""></img>
            </div>
        </div>
    );
}

export default Header;
